import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import UserProfile from './UserProfile';
import SearchBooks from './SearchBooks'; 
import IssuedBooks from './IssuedBooks'; 
import Wishlist from './Wishlist'; 
import FooterInside from './Footer_inside';

const Dashboarduser = () => {
  const [selectedNavItem, setSelectedNavItem] = useState('Dashboarduser');

  const renderSelectedContent = () => {
    switch (selectedNavItem) {
      case 'Dashboarduser':
        return (
          <div>
            <h2>Dashboarduser</h2>
            <p>Welcome to the Admin Dashboarduser of BookHub.</p>
          </div>
        );
      case 'UserProfile':
        return <UserProfile />;
      case 'SearchBooks':
        return <SearchBooks />;
      case 'IssuedBooks':
        return <IssuedBooks />;
      case 'Wishlist': // New case for managing members
        return <Wishlist />;
      default:
        return null;
    }
  };

  return (
    <div className="container-fluid">
      {/* Navbar and Sidebar code (same as before) */}

      <main className="col-md-9 ms-sm-auto col-lg-10 px-md-4">
        <div className="pt-3 pb-2 mb-3">
          {renderSelectedContent()}
        </div>
      </main>

      <FooterInside />
    </div>
  );
};

export default Dashboarduser;
